    [],nt"revision_timestamp": "2015-01-22T15:57:23.636967",nt"name": "assisted-housing-multifamily-properties-assisted",nt"isopen":
    false,nt"url": null,nt"notes": "HUD's Multifamily Housing property portfolio
    consist primarily of rental housing properties with five or more dwelling units
    such as apartments or town houses, but can also be nursing homes, hospitals, elderly
    housing, mobile home parks, retirement service centers, and occasionally vacant
    land. The portfolio can be broken down into two basic categories: insured and assisted.
    This layer depicts the latter category, HUDu0092s assisted Multifamily portfolio.
    HUD provides subsidies and grants to property owners and developers designed to
    promote the development and preservation of affordable rental units for low-income
    populations and those with special needs, such as the elderly and disabled. The
    three largest assistance programs for Multifamily housing are Section 8 Project
    Based Assistance, Section 202 Supportive Housing for the Elderly, and Section 811
    Supportive Housing for Persons with Disabilities. The Multifamily property locations
    depicted in this map service represent the approximate location of the property.
    The locations of individual buildings associated with each property are not depicted
    here. Generally speaking, the location of the property is derived from the primary
    address on file.",nt"license_title": "License Not Specified",nt"extras":
